import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './index.css';
const classes = ['I', 'II', 'III', 'IV', 'V', 'V1', 'V11', 'V111', '1X', 'X', 'X11', 'X12'];
const divisions = ['A', 'B', 'C'];
const genders = ['Male', 'Female'];

function App() {
  const [students, setStudents] = useState([]);
  const [formData, setFormData] = useState({
    name: '',
    dob: '',
    className: '',
    division: '',
    gender: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const getdata = async () => {
    const res = await axios.get('http://localhost:8080/students/list');
    setStudents(res.data);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      if (!formData.name || !formData.dob || !formData.className || !formData.division || !formData.gender) {
        alert('Please fill in all fields');
        return;
      }

      const response = await axios.post('http://localhost:8080/students/add', formData);
      if (response.status === 201) {
        alert('Student Information Successfully added');
      } else {
        alert('Error occurred');
      }

      getdata();

      setFormData({
        name: '',
        dob: '',
        className: '',
        division: '',
        gender: '',
      });
    } catch (error) {
      console.error('Error adding student:', error);
    }
  };

  useEffect(() => {
    getdata();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 py-12 px-4 sm:px-6 lg:px-8 flex justify-center items-center">
      <div className="max-w-md w-full space-y-8">
        <div>
          <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">Student Information Form</h2>
        </div>
        <form className="mt-8 space-y-6" onSubmit={handleSubmit}>
          <div>
            <label htmlFor="name" className="block text-sm font-medium text-gray-700">
              Name
            </label>
            <div className="mt-1">
              <input
                id="name"
                name="name"
                type="text"
                autoComplete="off"
                required
                value={formData.name}
                onChange={handleChange}
                className="appearance-none block w-full px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
              />
            </div>
          </div>
          <div>
            <label htmlFor="dob" className="block text-sm font-medium text-gray-700">
              Date of Birth
            </label>
            <div className="mt-1">
              <input
                id="dob"
                name="dob"
                type="date"
                required
                max={new Date().toISOString().split('T')[0]}
                value={formData.dob}
                onChange={handleChange}
                className="appearance-none block w-full px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
              />
            </div>
          </div>
          <div>
            <label htmlFor="className" className="block text-sm font-medium text-gray-700">
              Class
            </label>
            <div className="mt-1">
              <select
                id="className"
                name="className"
                required
                value={formData.className}
                onChange={handleChange}
                className="appearance-none block w-full px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
              >
                <option value="">Select Class</option>
                {classes.map((cls) => (
                  <option key={cls} value={cls}>
                    {cls}
                  </option>
                ))}
              </select>
            </div>
          </div>
          <div>
            <label htmlFor="division" className="block text-sm font-medium text-gray-700">
              Division
            </label>
            <div className="mt-1">
              <select
                id="division"
                name="division"
                required
                value={formData.division}
                onChange={handleChange}
                className="appearance-none block w-full px-3 py-2 border rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
              >
                <option value="">Select Division</option>
                {divisions.map((division) => (
                  <option key={division} value={division}>
                    {division}
                  </option>
                ))}
              </select>
            </div>
          </div>
          <div>
            <label className="block text-sm font-medium text-gray-700">Gender</label>
            <div className="mt-2">
              {genders.map((gender) => (
                <label key={gender} className="inline-flex items-center mr-4">
                  <input
                    type="radio"
                    className="form-radio"
                    name="gender"
                    value={gender}
                    checked={formData.gender === gender}
                    onChange={handleChange}
                  />
                  <span className="ml-2">{gender}</span>
                </label>
              ))}
            </div>
          </div>
          <div>
            <button
              type="submit"
              className="group relative w-full flex justify-center py-2 px-4 border border-transparent text-sm font-medium rounded-md text-white bg-blue-500 hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500"
            >
              Submit
            </button>
          </div>
        </form>
      </div>
      <div className="max-w-md w-full space-y-8 ml-6">
        <div>
          <h2 className="mt-6 text-center text-3xl font-extrabold text-gray-900">Student Details</h2>
        </div>
        <table className="table-fixed w-full">
          <thead>
            <tr>
              <th className="w-1/6 px-4 py-2">Admission Number</th>
              <th className="w-1/6 px-4 py-2">Name</th>
              <th className="w-1/6 px-4 py-2">Date of Birth</th>
              <th className="w-1/6 px-4 py-2">Class</th>
              <th className="w-1/6 px-4 py-2">Division</th>
              <th className="w-1/6 px-4 py-2">Gender</th>
            </tr>
          </thead>
          <tbody>
            {students.map((student, index) => (
              <tr key={index}>
                <td className="px-4 py-2">{student.admissionNumber}</td>
                <td className="px-4 py-2">{student.name}</td>
                <td className="px-4 py-2">{student.dob}</td>
                <td className="px-4 py-2">{student.className}</td>
                <td className="px-4 py-2">{student.division}</td>
                <td className="px-4 py-2">{student.gender}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default App;
